wwv_flow_api.create_page_process(
 p_id=>wwv_flow_api.id(52145686226609943)
,p_process_sequence=>10
,p_process_point=>'ON_SUBMIT_BEFORE_COMPUTATION'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'CALCULATE'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'apex_collection.create_or_truncate_collection( p_collection_name => ''PV_CALC'' );',
'commit;',
'',
'DECLARE',
unistr('  --warto\015Bci z  formularza w APEX'),
'   V_ANNUAL_POWER_RAISE       NUMBER := :P1_ANNUAL_POWER_RAISE;',
unistr('   V_CURRENT_USE_PCT          NUMBER := :P1_CURRENT_USE; --tyle % wyprodukowanej energii zu\017Cyjesz na bie\017C\0105co bez odsy\0142ania do elektrownii'),
'   V_EFFECTIVITY_YEARLY_LOSS  NUMBER := :P1_EFFECTIVITY_YEARLY_LOSS; -- roczny spadek uzysku paneli, procentowo',
unistr('   V_KWH_COST                 NUMBER := :P1_KWH_COST; -- Tw\00F3j koszt energii za 1kWh'),
'   V_KWP_PRODUCTION           NUMBER := :P1_KWP_PRODUCTION;-- uzysk roczny z 1kWp',
unistr('   V_PAYOFF_WAY_PCT           NUMBER := :P1_PAYOFF_WAY_PCT; --spos\00F3b rozliczenia 80 lub  70 %'),
unistr('   V_PERMANENT_COSTS          NUMBER := :P1_PERMANENT_COSTS; -- koszty sta\0142e energii, oko\0142o 240 z\0142 rocznie, przy korzystaniu z fotowoltaiki'),
unistr('   V_POWER_CONSUMPTION        NUMBER := :P1_POWER_CONSUMPTION;  -- szacowane zu\017Cycie roczne'),
'   V_PV_POWER                 NUMBER := :P1_PV_POWER; --moc instalacji',
'   V_REAL_COST                NUMBER := :P1_PV_REAL_COST;-- koszt instalacji po dotacjach i odliczeniach',
'',
'',
unistr('   --warto\015Bci do wyliczenia'),
unistr('   V_CURRENT_USE_KWH                     NUMBER; --ilo\015B\0107 energii produkowana i zu\017Cywana na bie\017C\0105co'),
unistr('   V_ENERGY_TO_BUY_KWH                   NUMBER; -- energia kt\00F3r\0105 musisz dokupi\0107 ponad to co wyuprodukujesz i odbierzesz'),
unistr('   V_ENERGY_TO_BUY_COST                  NUMBER; -- koszt zakupu energii ponad to co wyprodukowali\015Bmy ( 0 je\015Bli nam wystarczy\0142o)'),
unistr('   V_TOTAL_COST_HAVING_PV                NUMBER; --koszt energii posiadaj\0105\0107 PV'),
unistr('   V_PRODUCTION_KWH_SENT                 NUMBER; --nadwy\017Cka nie zu\017Cyta odes\0142ana do elektrownii w ci\0105gu roku'),
unistr('   V_RETRIEVED_ENERGY_KWH                NUMBER; -- tyle energii po odes\0142aniu i powrocie z elektrownii zostanie dla Ciebie   po potr\0105ceniu 20 lub 30% '),
unistr('   V_TOTAL_PRODUCTION_KWH                NUMBER; --\0142\0105czna ilo\015B\0107 wyprodukowanej pez Twoje PV energii'),
'   V_YEARLY_ENERGY_COST_WITHOUT_PV       NUMBER; --roczny koszt zakupu energii bez PV',
unistr('   V_PROFIT                              NUMBER; --zysk dzi\0119ki posiadaniu PV'),
unistr('   V_TOTAL_PROFIT                        NUMBER; --  \0142\0105czny zysk'),
unistr('   V_REMAIN_TO_RETURN                    NUMBER; -- kwota pozosta\0142a do zwrotu'),
unistr('   V_ENERGY_SURPLUS                      NUMBER; --nadwy\017Cka energii, kt\00F3ra prawdopodobnie przepadnie'),
'   ',
'BEGIN',
unistr('  --warto\015Bci dla 1 roku'),
'   V_TOTAL_PRODUCTION_KWH  := V_PV_POWER * V_KWP_PRODUCTION;',
'   V_CURRENT_USE_KWH       := V_TOTAL_PRODUCTION_KWH * V_CURRENT_USE_PCT/100;',
'   V_PRODUCTION_KWH_SENT   := V_TOTAL_PRODUCTION_KWH - V_CURRENT_USE_KWH;',
'   V_RETRIEVED_ENERGY_KWH  := V_PRODUCTION_KWH_SENT * V_PAYOFF_WAY_PCT/100;  ',
unistr('   V_ENERGY_TO_BUY_KWH     := V_POWER_CONSUMPTION - V_CURRENT_USE_KWH - V_RETRIEVED_ENERGY_KWH; --zu\017Cycie minus zu\017Cycie bie\017Cace minus odzyskane z elektrownii'),
'   V_YEARLY_ENERGY_COST_WITHOUT_PV  := V_POWER_CONSUMPTION * V_KWH_COST;',
'',
'    FOR cur IN 1..25 LOOP',
'',
unistr('      --je\015Bli ilo\015B\0107 kWh do zakupienia wysz\0142a na minusie to znaczy, \017Ce mamy jeszcze nadwy\017Ck\0119, wi\0119c wstawiam 0'),
'      IF V_ENERGY_TO_BUY_KWH < 0 THEN',
'        V_ENERGY_SURPLUS := NVL(ABS (V_ENERGY_TO_BUY_KWH),0);      ',
'        V_ENERGY_TO_BUY_KWH := 0;',
'      ELSIF V_ENERGY_TO_BUY_KWH > 0 THEN',
unistr('        NULL; -- je\015Bli ponad 0 to nic nie ruszam, tyle wstawi\0119'),
'        --V_ENERGY_TO_BUY_KWH := V_ENERGY_TO_BUY_KWH;',
'      END IF;',
'      ',
'      V_ENERGY_TO_BUY_COST    := V_ENERGY_TO_BUY_KWH * V_KWH_COST;  ',
unistr('      V_TOTAL_COST_HAVING_PV  := V_ENERGY_TO_BUY_COST + V_PERMANENT_COSTS; --koszt dokupu energii + koszty sta\0142e'),
'      V_PROFIT                := V_YEARLY_ENERGY_COST_WITHOUT_PV - V_TOTAL_COST_HAVING_PV;',
'      V_TOTAL_PROFIT          := NVL(V_TOTAL_PROFIT,0) + V_PROFIT;',
'      V_REMAIN_TO_RETURN       := V_TOTAL_PROFIT - V_REAL_COST;',
'      V_YEARLY_ENERGY_COST_WITHOUT_PV  := V_POWER_CONSUMPTION * V_KWH_COST;',
'',
'',
'    apex_collection.add_member(',
'        p_collection_name => ''PV_CALC'',',
'        p_c001 => V_POWER_CONSUMPTION, ',
'        p_c002 => V_ANNUAL_POWER_RAISE,',
'        p_c003 => V_KWH_COST,',
'        p_c004 => V_YEARLY_ENERGY_COST_WITHOUT_PV,',
'        p_c005 => V_EFFECTIVITY_YEARLY_LOSS,',
'        p_c006 => V_KWP_PRODUCTION,    ',
'        p_c007 => V_TOTAL_PRODUCTION_KWH, ',
'        p_c008 => V_CURRENT_USE_KWH,',
'        p_c009 => V_PRODUCTION_KWH_SENT, ',
'        p_c010 => V_RETRIEVED_ENERGY_KWH,',
'        p_c011 => V_ENERGY_TO_BUY_KWH,',
'        p_c012 => V_ENERGY_TO_BUY_COST,',
'        p_c013 => V_PERMANENT_COSTS,               ',
'        p_c014 => V_TOTAL_COST_HAVING_PV,',
'        p_c015 => V_PROFIT,',
'        p_c016 => V_REAL_COST,',
unistr('        p_c017 => V_TOTAL_PROFIT, --\0142\0105czny zysk'),
unistr('        p_c018 => V_REMAIN_TO_RETURN, --pozosta\0142o do zwrotu'),
'        p_c019 =>  V_ENERGY_SURPLUS   ',
'',
'    );',
unistr('    --warto\015Bci w kolejnych latach'),
unistr('     V_KWH_COST               := V_KWH_COST + (V_KWH_COST * V_ANNUAL_POWER_RAISE/100); --koszt zakupu 1 kWh z uwzgl\0119dnieniem podwy\017Ckli'),
unistr('     V_PERMANENT_COSTS        := V_PERMANENT_COSTS + (V_PERMANENT_COSTS * V_ANNUAL_POWER_RAISE/100); --koszty sta\0142e z uwzgl\0119dnieniem podwy\017Ck,i'),
'     V_KWP_PRODUCTION         := V_KWP_PRODUCTION - (V_KWP_PRODUCTION * V_EFFECTIVITY_YEARLY_LOSS/100); --uzysk z 1KwP w kolejnym roku',
'     V_TOTAL_PRODUCTION_KWH   := V_PV_POWER * V_KWP_PRODUCTION;',
unistr('     V_CURRENT_USE_KWH        := V_TOTAL_PRODUCTION_KWH * V_CURRENT_USE_PCT/100; --tyle zu\017Cyjesz na bie\017C\0105co'),
'     V_PRODUCTION_KWH_SENT    := V_TOTAL_PRODUCTION_KWH - V_CURRENT_USE_KWH;',
'     V_RETRIEVED_ENERGY_KWH   := V_PRODUCTION_KWH_SENT * V_PAYOFF_WAY_PCT/100; --tyle energii odzyskasz z elektrowni',
unistr('     V_ENERGY_TO_BUY_KWH      := V_POWER_CONSUMPTION - V_CURRENT_USE_KWH - V_RETRIEVED_ENERGY_KWH; --zu\017Cycie minus zu\017Cycie bie\017Cace minus odzyskane z elektrownii'),
unistr('     V_ENERGY_TO_BUY_COST     := V_ENERGY_TO_BUY_KWH * V_KWH_COST; --koszt dokupienia eneergii je\015Bli nie starczy\0142o, uwzgl\0119dnia podwy\017Cki cen'),
'     V_TOTAL_COST_HAVING_PV   := V_ENERGY_TO_BUY_COST + V_PERMANENT_COSTS;',
'',
'',
'',
'     END LOOP;',
'    commit;',
'END;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_api.id(33004437299192015)
);
end;
